    function loc(x){
      x = x.replace(/(\r\n|\n|\r|\s)/gm,"");
      return x;
    }
    decrypt.onclick = async function(){
        let text = loc(encryptText.value);
        let minKeyLength1 = parseInt(minKeyLength.value);
        let maxKeyLength1 = parseInt(maxKeyLength.value);
        myBar.style.width = 0;
        let depth = parseInt(depthInput.value);
        let tham = new thammaBang(text, depth, minKeyLength1, maxKeyLength1);
        tham.bruteKeyLength();
    }

    encryptText.value = localStorage.encryptText;
    encryptText.addEventListener('input', function(){
      localStorage.encryptText = encryptText.value;
    })

    class thammaBang{
      constructor(text, depth, minKeyLength1, maxKeyLength1){
        this.text = text;
        this.depth = depth;
        this.n_tops = 10;
        this.topScores = [];
        this.topResults = [];
        this.minKeyLength = minKeyLength1;
        this.maxKeyLength = maxKeyLength1;
        this.progress = 0;
        this.keyLength = {};
      }
      async getScoreTwoCol(x,y){
        if (x.length != y.length){
          console.log("ERROR");
          return 0;
        }
        let score = 0;
        for(let i=0;i<x.length;++i)
          if (frequence.hasOwnProperty(x[i]+y[i]))
            score += frequence[x[i]+y[i]];
        console.log('score',score);
        return score;
      }

      async getScoreText(x){
        let score = 0;
        for(let i=0;i<x.length-2;++i)
          if (frequence3.hasOwnProperty(x[i]+x[i+1]+x[i+2]))
            score += frequence3[x[i]+x[i+1]+x[i+2]];
        return score;
      }
      
      createButton(text){
        let btnResult = document.createElement("input");
        btnResult.value = text;
        btnResult.style.width = '100%';
        btnResult.style.marginTop = '10px';
        btnResult.style.fontSize = 'large'
        btnResult.disabled = true;
        return btnResult;
      }

      async getText(longColumnsIndex, shortColumnsIndex, columns){
        let textResult = "";
        let numRows = Math.floor(this.text.length/columns.length) + (this.text.length%columns.length != 0);
        
        for(let row=0;row < numRows; ++row){
          for (let j=0;j<longColumnsIndex.length;++j)
            textResult += columns[longColumnsIndex[j]][row];
          
          if (textResult.length < this.text.length)
            for (let j=0;j<shortColumnsIndex.length;++j)
              textResult += columns[shortColumnsIndex[j]][row];
        }
        return textResult;
      }

      async find_best(chain){
        let cntText = this.text;
        var longColumnsIndex = [];
        var shortColumnsIndex = [];
        var columns = new Array(chain.length);
        let length_shortColumns = Math.floor(this.text.length/chain.length);

        for(let i=0;i<chain.length;++i){

          if (chain[i] == 0){
            columns[i] = cntText.substring(0,length_shortColumns);
            cntText = cntText.substring(length_shortColumns);
            shortColumnsIndex.push(i);
          }
          else{            
            columns[i] = cntText.substring(0,length_shortColumns+1);
            cntText = cntText.substring(length_shortColumns+1);
            longColumnsIndex.push(i);
          }
        }

        for (let i=0;i<this.depth;++i){
          let randomLongColumnsIndex = longColumnsIndex.sort(() => Math.random() - 0.5);
          let randomShortColumnsIndex = shortColumnsIndex.sort(() => Math.random() - 0.5);
          let randomText = await this.getText(randomLongColumnsIndex, randomShortColumnsIndex, columns);
          this.keyLength[randomText] = columns.length;
          // if (!randomText.includes('BIENDOIKHIHAU')){
          //   continue;
          // }
          // console.log(randomText);
          //console.log('randomLongColumnsIndex',randomLongColumnsIndex);
          //console.log('randomShortColumnsIndex',randomShortColumnsIndex);
         // console.log('columns',columns);
          //console.log('randomText',randomText);
          let textScore = await this.getScoreText(randomText);
          //console.log('textScore',textScore);
          if (this.topScores.length > this.n_tops){
            if (this.topScores[this.n_tops-1] < textScore){
              this.topScores.unshift(textScore);
              this.topResults.unshift(randomText);
              this.topScores.pop();
              this.topResults.pop();
            }
          }
          else {
            this.topScores.push(textScore);
            this.topResults.push(randomText);
          }
        }
      }

      async next_case(nums_LongColumns, nums_ShortColumns, cntChain){
        if (nums_LongColumns > 0)
          await this.next_case(nums_LongColumns-1, nums_ShortColumns, cntChain+'1');
        if (nums_ShortColumns > 0)
          await this.next_case(nums_LongColumns, nums_ShortColumns-1, cntChain+'0');
        
        if (nums_LongColumns==0 && nums_ShortColumns == 0)
          await this.find_best(cntChain);
        return ;
      }
      async bruteKeyLength(){
        let n = this.maxKeyLength - this.minKeyLength+1;
        let i = 0;
        myBar.style.width = 0;
        for (let keyLength = this.minKeyLength;keyLength<=this.maxKeyLength; ++keyLength){
          console.log("keyLength ", keyLength);
          i+=1;          
          this.progress = Math.floor(i*100/n);
          let nums_LongColumns = this.text.length % keyLength;
          let nums_ShortColumns = keyLength - nums_LongColumns;
          await this.next_case(nums_LongColumns, nums_ShortColumns, "");
          await this.displayResult();

          console.log(keyLength);
          console.log(this.topScores[0]);
        }
      }
      async displayResult(){
        myBar.style.width = this.progress+"%";
        while (results.firstChild)
          results.removeChild(results.firstChild);
        for (let i=0;i<this.topResults.length;++i){
          let resultCandidate = this.createButton(this.topResults[i] + ' '+ this.keyLength[this.topResults[i]]);
          console.log(this.topScores[i]);
          results.appendChild(resultCandidate);
        }
        return ;
      }
    }
  


    
  </script>
